import React from 'react';

const Contact = () =>{
    return (
       <>
       <div className="contact">
        <div className="contact1">
            <h1>Contact Us</h1>
        </div>
        <div className="contact2">
            <label for="">Full Name</label><br/>
                <input type="text" placeholder="Name"/>
        </div>
       </div>
       </>
    )
}

export default Contact;
